import { create } from 'zustand';

export const useInterviewStore = create((set) => ({
  parsedResume: null,
  questions: [],
  answers: [],

  setParsedResume: (parsedResume) => set({ parsedResume }),
  setQuestions: (questions) => set({ questions }),
  setAnswers: (answers) => set({ answers }),
}));
